import React, { useState } from 'react';

const Test = () => {
    const [serverFiles, setServerFiles] = useState([
        { id: 1, type: 'image', file: 'image1.jpg' },
        { id: 2, type: 'video', file: 'video1.mp4' },
        { id: 3, type: 'document', file: 'doc1.pdf' }
    ]);

    const [sourcesList, setSourcesList] = useState([
        { id: 4, type: 'image', file: 'image2.jpg' },
        { id: 5, type: 'video', file: 'video2.mp4' },
        { id: 6, type: 'document', file: 'doc2.pdf' }
    ]);

    const handleMoveToServer = (item) => {
        setServerFiles([...serverFiles, item]);
        setSourcesList(sourcesList.filter(source => source.id !== item.id));
    };

    const handleMoveToSources = (item) => {
        setSourcesList([...sourcesList, item]);
        setServerFiles(serverFiles.filter(file => file.id !== item.id));
    };

    return (
        <div>
            <h2>Server Files</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Type</th>
                        <th>File</th>
                    </tr>
                </thead>
                <tbody>
                    {serverFiles.map(item => (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.type}</td>
                            <td>{item.file}</td>
                            <td>
                                <button onClick={() => handleMoveToSources(item)}>Move to Sources</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h2>Sources List</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Type</th>
                        <th>File</th>
                    </tr>
                </thead>
                <tbody>
                    {sourcesList.map(item => (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.type}</td>
                            <td>{item.file}</td>
                            <td>
                                <button onClick={() => handleMoveToServer(item)}>Move to Server</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Test;
